CREATE TRIGGER `InsertMonthlyPayments` BEFORE INSERT ON `Monthly_Payments` FOR EACH ROW BEGIN
    DECLARE gross DECIMAL(10, 2);
    DECLARE tax DECIMAL(10, 2);
    DECLARE nic DECIMAL(10, 2);
    DECLARE retirement DECIMAL(10, 2);
    DECLARE net_employee_pay DECIMAL(10, 2);
    DECLARE net_company_pay DECIMAL(10, 2);

    -- Calculate Gross Pay
    SET gross = NEW.base_pay + NEW.bonus + NEW.incentives;

    -- Calculate Tax based on Gross Pay
    IF gross < 1666 THEN
        SET tax = gross * 0.00; -- 0% tax
    ELSEIF gross >= 1666 AND gross < 40000 THEN
        SET tax = gross * 0.20; -- 20% tax
    ELSEIF gross >= 3333 AND gross < 6666 THEN
        SET tax = gross * 0.30; -- 30% tax
    ELSE
        SET tax = gross * 0.40; -- 40% tax
    END IF;

    -- Calculate NIC and Retirement
    SET nic = gross * 0.12; -- 12% NIC
    SET retirement = gross * 0.05; -- 5% retirement

    -- Calculate Net Employee Pay
    SET net_employee_pay = gross - tax - retirement;

    -- Calculate Net Company Pay
    SET net_company_pay = gross + NEW.allowance;

    -- Set the NEW row with calculated values
    SET NEW.tax = tax;
    SET NEW.nic = nic;
    SET NEW.retirement = retirement;
    SET NEW.net_employee_pay = net_employee_pay;
    SET NEW.net_company_pay = net_company_pay;
END
$$
DELIMITER ;
